    case 77: /* param_num */
    case 78: /* exclusive_param_num */
    case 79: /* vector_score_field */
    case 80: /* as */
    case 81: /* param_term_case */
    case 82: /* param_size */
{
 
}
      break;
    case 46: /* expr */
    case 49: /* affix */
    case 50: /* affix_tag */
    case 51: /* suffix */
    case 52: /* contains */
    case 53: /* verbatim */
    case 54: /* termlist */
