        break;
      case 5: /* expr ::= expr expr */
      case 6: /* expr ::= text_expr expr */ yytestcase(yyruleno==6);
      case 7: /* expr ::= expr text_expr */ yytestcase(yyruleno==7);
      case 8: /* text_expr ::= text_expr text_expr */ yytestcase(yyruleno==8);
      case 9: /* text_expr ::= text_expr unaryop_text_expr */ yytestcase(yyruleno==9);
      case 10: /* text_expr ::= unaryop_text_expr text_expr */ yytestcase(yyruleno==10);
